.checkbox {
    position: relative;
    min-height: 30px;
    padding-left: 30px;

    &__input {
        position: absolute;
        right: 10px;
        width: 1px;
        height: 1px;
        overflow: hidden;
        padding: 0;
        margin: -1px;
        border: none;
        outline: none;
        clip: rect(1px, 1px, 1px, 1px);
    }

    &__presentation {
        display: block;
        position: absolute;
        left: 0;
        top: 0;
        width: 18px;
        height: 18px;
        border: solid 1px $color-purple;
        border-radius: 4px;
        cursor: pointer;
    }

    &__input:checked+&__label>&__presentation {
        background-image: url(../img/checkbox__tick.svg);
        background-repeat: no-repeat;
        background-position: center;
    }

    &__input:disabled+&__label {
        cursor: auto;
    }

    &__input:disabled+&__label>&__presentation {
        border-color: $color-ds25;
        cursor: auto;
    }

    &__input:focus+&__label>&__presentation {
        outline: none;
        box-shadow: 0 0 1px 2px white, 0 0 3px 3px rgba(0, 0, 255, 0.15);
    }

    &__input:active+&__label>&__presentation {

        outline: none;
        box-shadow: 0 0 1px 2px white, 0 0 3px 3px rgba(255, 0, 0, 0.3);

    }

    &__label {
        color: $color-ds50;
        font-family: 'Montserrat', sans-serif;
        font-style: normal;
        font-weight: normal;
        font-size: 14px;
        line-height: 18px;
        cursor: pointer;
        user-select: none;
    }

}

